description:
Jan  Karski's Story  of  a Secret  State  stands as  one  of the  most
poignant and inspiring memoirs of World War II and the Holocaust. With
elements of a spy thriller,  documenting his experiences in the Polish
Underground,  and as  one  of  the first  accounts  of the  systematic
slaughter of the Jews by the German Nazis, this volume is a remarkable
testimony of one man's courage  and a nation's struggle for resistance
against overwhelming oppression.
